#
# TABLE STRUCTURE FOR: actors
#

DROP TABLE IF EXISTS `actors`;

CREATE TABLE `actors` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL,
  `information` text COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: actors_in_films
#

DROP TABLE IF EXISTS `actors_in_films`;

CREATE TABLE `actors_in_films` (
  `actor_id` bigint(20) unsigned NOT NULL,
  `film_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`actor_id`,`film_id`),
  KEY `film_id` (`film_id`),
  CONSTRAINT `actors_in_films_ibfk_1` FOREIGN KEY (`actor_id`) REFERENCES `actors` (`id`),
  CONSTRAINT `actors_in_films_ibfk_2` FOREIGN KEY (`film_id`) REFERENCES `films` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: cartoon_rating
#

DROP TABLE IF EXISTS `cartoon_rating`;

CREATE TABLE `cartoon_rating` (
  `user_id` bigint(20) unsigned NOT NULL,
  `cartoon_id` bigint(20) unsigned NOT NULL,
  `grade` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`cartoon_id`),
  KEY `cartoon_id` (`cartoon_id`),
  CONSTRAINT `cartoon_rating_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `cartoon_rating_ibfk_2` FOREIGN KEY (`cartoon_id`) REFERENCES `cartoons` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: cartoon_review
#

DROP TABLE IF EXISTS `cartoon_review`;

CREATE TABLE `cartoon_review` (
  `user_id` bigint(20) unsigned NOT NULL,
  `cartoon_id` bigint(20) unsigned NOT NULL,
  `review` text COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`user_id`,`cartoon_id`),
  KEY `cartoon_id` (`cartoon_id`),
  CONSTRAINT `cartoon_review_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `cartoon_review_ibfk_2` FOREIGN KEY (`cartoon_id`) REFERENCES `cartoons` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: cartoons
#

DROP TABLE IF EXISTS `cartoons`;

CREATE TABLE `cartoons` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL,
  `year` year(4) DEFAULT NULL,
  `genre_id` bigint(20) unsigned NOT NULL,
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `country_id` bigint(20) unsigned NOT NULL,
  `duration` smallint(5) unsigned NOT NULL,
  `poster` bigint(20) unsigned DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `genre_id` (`genre_id`),
  KEY `country_id` (`country_id`),
  CONSTRAINT `cartoons_ibfk_1` FOREIGN KEY (`genre_id`) REFERENCES `genre` (`id`),
  CONSTRAINT `cartoons_ibfk_2` FOREIGN KEY (`country_id`) REFERENCES `country` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: country
#

DROP TABLE IF EXISTS `country`;

CREATE TABLE `country` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: film_rating
#

DROP TABLE IF EXISTS `film_rating`;

CREATE TABLE `film_rating` (
  `user_id` bigint(20) unsigned NOT NULL,
  `film_id` bigint(20) unsigned NOT NULL,
  `grade` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`user_id`,`film_id`),
