INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('3', '476', 'Aut rem sunt tempora dolore veritatis. Nulla id qui at in. Voluptas quod et sit aut nihil.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('4', '207', 'Nesciunt velit voluptatem totam ut. Sint et omnis minus aut. Reiciendis eum consequuntur illum amet et sed. Aut cupiditate non atque tempore qui aut.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('10', '307', 'Et impedit in exercitationem libero et. Eum blanditiis quas et nihil qui eos aliquid. Beatae quis sed est aliquid explicabo ut. Dolor possimus amet cumque molestias molestias repudiandae aut.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('10', '420', 'Sit unde nostrum fuga porro itaque. Asperiores magni labore et illum earum voluptatem. Atque et totam placeat repellat impedit veritatis voluptatem.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('12', '171', 'Qui facilis quis perspiciatis corrupti. Quis qui eos earum eos totam. Aut aut veniam quia minima ut ullam. Quibusdam enim et et nisi exercitationem.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('14', '400', 'Non animi quia ea voluptatibus quia ex sequi. Explicabo voluptas in et eos eos adipisci nostrum. Laborum corrupti autem et possimus mollitia.');
INSERT INTO `film_review` (`user_id`, `film_id`, `review`) VALUES ('23', '277', 'Odio aut quae omnis aut velit impedit. Ut quos doloremque non voluptates commodi qui corporis. Id voluptas sed sed adipisci totam inventore veritatis. Aut et rerum autem veritatis mollitia et.');
